import { Component } from '@angular/core';
import { LoginservisService } from '../servisi/loginservis.service';
import { Nastavnik } from '../models/nastavnik';
import { Predmet } from '../models/predmet';
import { Router } from '@angular/router';

@Component({
  selector: 'app-admin',
  templateUrl: './admin.component.html',
  styleUrls: ['./admin.component.css']
})
export class AdminComponent {
  constructor(private servis :LoginservisService, private router : Router ){}
  nastavnici : Nastavnik[] = []
  predmeti : Predmet[] = []
  predmettoadd : string = ""

  ngOnInit(){
      this.servis.nastavnikwait().subscribe(rez =>{
        this.nastavnici = rez
      })
      this.servis.getpredmeti(0).subscribe(rez=>{
        this.predmeti = rez
      })
  }

  prihvatiNastavnika(name : string){
    this.servis.potvrdinastavnikagain(name,1).subscribe(rez=>{
    })
    this.ngOnInit()
  }

  odbijNastavnika(name : string){
    this.servis.potvrdinastavnikagain(name,0).subscribe(rez=>{

    })
    this.ngOnInit()
  }

  addPredmet(name : string){
    this.servis.potvrdipredmet(name,1).subscribe(rez=>{

    })
    this.ngOnInit()
  }

  rejectPredmet(name : string){
    this.servis.potvrdipredmet(name,2).subscribe(rez=>{

    })
    this.ngOnInit()
  }

  addPr(name : string){
    this.servis.addpredmeti(name,1).subscribe(rez=>{

    })
    this.ngOnInit()
  }


  LogOut(){
    localStorage.clear
    this.router.navigate([''])
  }


}
<h3>Pregled prijava nastavnika:</h3>
<table>
  <ng-container *ngFor = "let nst of nastavnici ">
    <tr>
      <td>
        {{nst.username}}
      </td>
      <td>
        <button type="button" (click)="prihvatiNastavnika(nst.username)" >PrihvatiNastavnika</button>
      </td>
      <td>
        <button type="button" (click)="odbijNastavnika(nst.username)" >OdbijNastavnika</button>
      </td>
    </tr>

  </ng-container>
</table>
<h3>Pregled predmeta:</h3>
<table>
  <ng-container *ngFor = "let prdmt of predmeti ">
    <tr>
      <td>
        {{prdmt.predmet}}
      </td>
      <td>
        <button type="button" (click)="addPredmet(prdmt.predmet)" >PrihvatiPredmet</button>
      </td>
      <td>
        <button type="button" (click)="rejectPredmet(prdmt.predmet)" >OdbijPredmet</button>
      </td>
    </tr>

  </ng-container>
</table>

<h3>Dodaj Predmet:</h3>
<input type ="text" [(ngModel)] = "predmettoadd">
<button type="button" (click)="addPr(predmettoadd)" >DodajPredmet</button>
